import React, {useEffect, useState} from "react";
import {useParams, Link} from "react-router-dom";
import axios from "axios";

const MAIN_API = 'http://i9a608.p.ssafy.io:8000/project/'
const SUB_API = '/article'
const ProjectDetailPage = () => {
  const stamps = [

  ]
  const { projectId } = useParams()
  const [project, setProject] = useState([]);
  const [myArticles, setMyArticles] = useState([
    {
      'article_created': '2023-07-01',
      'article_updated': '2023-07-02',
      'article_img': "",
      'article_stamp': '6',
      'article_title': '  001',
      'article_content': '  001',
      'article_idx': '1',
    }
  ])

  useEffect(() => {
    axios.get(`${MAIN_API}${projectId}`
      , {
      headers: {
        userId: 1001,
      },
    }
    )
      .then((response) => {
        console.log('')
        console.log(response.data)
        setProject(response.data);
      })
      .catch((error) => {
        console.error("   ", error);
        console.error(error.code)
      });
  }, []);

  useEffect(() => {
    axios.get(`${MAIN_API}${projectId}${SUB_API}`
      , {
        headers: {
          userId: 1001,
        },
      }
    )
      .then((response) => {
        console.log('')
        console.log(response.data)
        setMyArticles(response.data);
      })
      .catch((error) => {
        console.error("   ", error);
        console.error(error.code)
      });
  }, []);


  return (
    <>
      <div style={{width: "800px"}}>
        <div>
          <h1>  : {project.title}</h1>
        </div>
        <div>
          <div>
            <p>   : {myArticles.length} </p>
            <p> : {myArticles.length} / {project.articles_length} %</p>
            <p>   : {project.started} ~ {project.ended}</p>
          </div>
          <button></button>
        </div>
        <br/>
        <hr/>
        <br/>
        <div>
          <h2>History</h2>
          {myArticles.map((article) => (
            <div key={article.idx} >
              <h3 style={{margin: "1rem"}}>{article.article_created}</h3>
              <div style={{margin: "1rem", width:"95%", display:"flex", alignItems:"center", justifyContent:"space-around", border: "solid 0.5px black"}}>
                <div>
                  {article.article_img && (
                    <img src={`data:image/png;base64,${article.article_img}`} alt="   "/>
                  )}
                </div>
                <div>
                  {article.article_stamp && (
                    <img src={stamps[article.article_stamp - 1]} alt="   "/>
                  )}
                  <p>{article.article_content}</p>
                </div>
              </div>
            </div>
          ))}

        </div>
        <br/><br/>
        <Link to={`/project/${projectId}/create`}>
          <button>
              
          </button>
        </Link>
        <br/><br/>
        <hr/>
        <br/>
      </div>
    </>
  )
}

export default ProjectDetailPage;
